function App() {
	const [backendData, setBackendData] = useState([{}]);

	const fetchData = () => {
		// test call to backend ************
		// fetch("/api")
		// 	.then((response) => response.json())
		// 	.then((data) => {
		// 		setBackendData(data);
		// 	});

		// TEST CALL TO BACKEND TO TRIGGER CALL TO ZOOM API
		// const data = {
		// 	"topic": "test class!",
		// 	"type": 2,
		// 	"start_time": "2022-01-17T19:00:00",
		// 	"duration": 60,
		// };
		fetch("/api", {
			method: "POST",
      headers: {
        'Content-Type': 'application/json'
      },
      body: {
        "topic": "test class!",
        "type": 2,
        "start_time": "2022-01-17T19:00:00",
        "duration": 60,
      }
		})
			.then((response) => response.json())
			.then((data) => {
				setBackendData(data);
			});
	};

	return (
		<div>
			<button onClick={fetchData}>fetch data</button>
		</div>
	);
}

export default App;
